import React from 'react';

class TimeInfo extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        const {value}=this.props
        return(
            <div className="time" style={{ border:"1px solid grey",width: "18rem", display:"inline-block" }}>
                 <button onClick={()=>{this.props.handleDelete(this.props.id)}} className="btn btn-danger">X</button>
                 <div className="time-body">
                    <p>{value}</p>
                 </div>
            </div>
        )
    }
}

export default TimeInfo;
